import React, {Component} from 'react';


class TimeCard extends Component {

    render() { 
        return (
            <div className="bgAll">
                <div className="bgProfileCard container d-flex justify-content-end align-items-center">
                    <img className="w-50" src={this.props.logo}    /> 
                </div>
                    
                <div className="bgProfilebas2 container ">
                    <p className="text-white">Daily</p> <span className="text-white">. . .</span>
                    <p className="text-white">32hrs</p>
                    <p className="text-white">Last Week - 36hrs</p>
                </div>
            </div>
        );
    }
}

export default TimeCard;
